        #region Сөздік қорды жаңалау +UpdateWordsPack()
        public static void UpdateWordsPack()
        {
            string jsonFolder = System.IO.Directory.GetCurrentDirectory() + "/json/";
            try
            {
                string words_pack_json = jsonFolder + "words_pack.json";
                string jsonStr = System.IO.File.ReadAllText(words_pack_json);
                var dic = JsonHelper.DeserializeObject<Dictionary<string, string>>(jsonStr);
                foreach (var item in dic)
                {
                    if (wordsPackDic.ContainsKey(item.Key))
                    {
                        wordsPackDic[item.Key] = item.Value;
                    }
                    else
                    {
                        wordsPackDic.Add(item.Key, item.Value);
                    }
                }
            }
            catch (Exception ex)
            {
               // Serilog.Log.Error(ex, "Латын » Кирилл сөздер тізімін алуда қателык көрілді! ");
            }

            try
            {
                string words_pack_json = jsonFolder + "latyn2cyrl_words_pack.json";
                string jsonStr = System.IO.File.ReadAllText(words_pack_json);
                var dic = JsonHelper.DeserializeObject<Dictionary<string, string>>(jsonStr);
                foreach (var item in dic)
                {
                    if (latyn2CyrlWordsPackDic.ContainsKey(item.Key))
                    {
                        latyn2CyrlWordsPackDic[item.Key] = item.Value;
                        
                    }
                    else
                    {
                        latyn2CyrlWordsPackDic.Add(item.Key, item.Value);
                    }
                }
            }
            catch (Exception ex)
            {
               // Serilog.Log.Error(ex, "Латын » Кирилл сөздер тізімін алуда қателык көрілді! ");
            }
        }
        #endregion

        #region Мазмұнды сәйкестендіру + ConvertText(string convertType, string text)
        public static string ConvertText(string convertType, string text)
        {
            string result = string.Empty;
            switch (convertType.Trim().ToLower())
            {
                case "cyrl2latyn": { result = ConvertHelper.Cyrl2Latyn(text); } break;
                case "latyn2cyrl": { result = ConvertHelper.Latyn2Cyrl(text); } break;
                case "latyn2tote": { result = ConvertHelper.Latyn2Tote(text); } break;
                case "tote2latyn": { result = ConvertHelper.Tote2Latyn(text); } break;
                case "cyrl2tote": { result = ConvertHelper.Kaz2Tote(text); } break;
                default: { result = text; } break;
            }
            return result;
        }
        #endregion

        #region Сөздің бірінші әрпін үлкенге айналдыру +FirstCharToUpper(string input)
        private static string FirstCharToUpper(string input)
        {
            if (string.IsNullOrEmpty(input)) return input;
            return QazLatynToUpper(input.Substring(0, 1)) + input.Substring(1);
        }
        #endregion

        #region Сөздерді үлкен-кіші жазылуына қарай сәйкестендіру +ConvertWord(string oldValue, string newValue)
        private static string ConvertWord(string oldValue, string newValue)
        {
            if (string.IsNullOrEmpty(oldValue)) return string.Empty;

            return oldValue.Equals(QazLatynToUpper(oldValue)) ? QazLatynToUpper(newValue):
                oldValue.Equals(FirstCharToUpper(oldValue)) ? FirstCharToUpper(newValue) : QazLatynToLower(newValue);
        }

        #endregion

