                        if (i > 0) Tmp1 = Tmp[i - 1];
                        else Tmp1 = Tmp[i];
                        char Tmp2;
                        if (i < strLenght - 1)
                            Tmp2 = Tmp[i + 1];
                        else
                            Tmp2 = Tmp[i];
                        if ((Tmp[i] == '\u0065' | Tmp[i] == '\u0045') & (Tmp1 > '\u007A' | Tmp2 > '\u007A'))
                            sb.Append("\u06D5");
                        else if ((Tmp[i] == '\u0069' | Tmp[i] == '\u0049') & (Tmp1 > '\u007A' | Tmp2 > '\u007A'))
                            sb.Append("\u0649");
                        else
                            sb.Append(Tmp[i]);
                        break;
                }
            }
            return sb.Replace(" - ", "-").ToString();
        }
