        private static bool IsLatinSoz(string str)
        {
            bool solay = false;
            char[] chr = new char[str.Length];
            chr = str.ToCharArray();
            for (int i = 0; i < chr.Length; i++)
            {
                if (chr[i] < 255)
                    solay = true;
                else
                {
                    if (i > 0 && chr[i - 1] > 255)
                    {
                        solay = false;
                        break;
                    }
                }
            }
            return solay;
        }
        private static string StrInsert(string str)
        {
            try
            {
                string temp = str;
                char[] chr = new char[str.Length];
                chr = str.ToCharArray();
                for (int i = 0; i < chr.Length; i++)
                {
                    if (chr[i] > 255 && i == 0)
                    {
                        if (str.Contains("\n"))
                        {
                            temp = str.Insert(str.IndexOf("\n") + 1, "'");
                        }
                        else
                        {
                            temp = str.Insert(0, "'");
                        }
                        break;
                    }
                    if (chr[i] > 0x0444 && i > 0)
                    {
                        for (int j = 0; j <= i; j++)
                        {
                            if (chr[j] > 255)
                            {
                                if (str.Contains("\n"))
                                {
                                    temp = str.Insert(j + str.IndexOf("\n"), "'");
                                }
                                else
                                {
                                    temp = str.Insert(j, "'");
                                }
                                break;
                            }
                        }
                        break;
                    }
                }
                return temp;
            }
            catch { return str; }
        }
