                            if (j > lastStartIndex && !string.IsNullOrEmpty(cyrlStrs[j - 1]))
                            {
                                prevSound = vowelChars.Contains(cyrlStrs[j - 1].ToUpper()) ? Sound.Vowel : Sound.Consonant;
                            }

                            if (j + 1 < length)
                            {
                                string key = string.Concat(chars[j], chars[j + 1]);
                                switch (QazLatynToLower(key))
                                {
                                    case "ıý": { cyrlStrs[j] = ConvertWord(key, (prevSound != Sound.Consonant) ? "ю" : "ию"); j += 1; continue; }
                                    case "ıa": { cyrlStrs[j] = ConvertWord(key, (prevSound != Sound.Consonant) ? "я" : "ия"); j += 1; continue; }
                                    case "sh": { cyrlStrs[j] = ConvertWord(key, "ш"); j += 1; continue; }
                                    case "ch": { cyrlStrs[j] = ConvertWord(key, "ч"); j += 1; continue; }
                                    case "ХХ": { cyrlStrs[j] = "XX"; j += 1; continue; }
                                }
                            }
                            switch (chars[j].ToString())
                            {
                                case "I":
                                    {
                                        if (j > 0 && !string.IsNullOrEmpty(cyrlStrs[j - 1]) && vowelChars.Contains(cyrlStrs[j - 1].ToUpper()))
                                        {
                                            cyrlStrs[j] = "Й";
                                        }
                                        else
                                        {
                                            cyrlStrs[j] = "И";
                                        }
                                    }
                                    break;
                                case "ı":
                                    {
                                        if (j > 0 && !string.IsNullOrEmpty(cyrlStrs[j - 1]) && vowelChars.Contains(cyrlStrs[j - 1].ToUpper()))
                                        {
                                            cyrlStrs[j] = "й";
                                        }
                                        else
                                        {
                                            cyrlStrs[j] = "и";
                                        }
                                    }
                                    break;
                                case "Á": { cyrlStrs[j] = "Ә"; } break;
                                case "á": { cyrlStrs[j] = "ә"; } break;
                                case "Ó": { cyrlStrs[j] = "Ө"; } break;
                                case "ó": { cyrlStrs[j] = "ө"; } break;
                                case "Ú": { cyrlStrs[j] = "Ү"; } break;
                                case "ú": { cyrlStrs[j] = "ү"; } break;
                                case "Ń": { cyrlStrs[j] = "Ң"; } break;
                                case "ń": { cyrlStrs[j] = "ң"; } break;
                                case "Ǵ": { cyrlStrs[j] = "Ғ"; } break;
                                case "ǵ": { cyrlStrs[j] = "ғ"; } break;
                                case "Ý": { cyrlStrs[j] = "У"; } break;
                                case "ý": { cyrlStrs[j] = "у"; } break;
                                case "A": { cyrlStrs[j] = "А"; } break;
                                case "a": { cyrlStrs[j] = "а"; } break;
                                case "B": { cyrlStrs[j] = "Б"; } break;
                                case "b": { cyrlStrs[j] = "б"; } break;
                                case "S": { cyrlStrs[j] = "С"; } break;
                                case "s": { cyrlStrs[j] = "с"; } break;
                                case "D": { cyrlStrs[j] = "Д"; } break;
                                case "d": { cyrlStrs[j] = "д"; } break;
                                case "E": { cyrlStrs[j] = "Е"; } break;
                                case "e": { cyrlStrs[j] = "е"; } break;
                                case "F": { cyrlStrs[j] = "Ф"; } break;
                                case "f": { cyrlStrs[j] = "ф"; } break;
                                case "G": { cyrlStrs[j] = "Г"; } break;
                                case "g": { cyrlStrs[j] = "г"; } break;
                                case "H": { cyrlStrs[j] = "Х"; } break;
                                case "h": { cyrlStrs[j] = "х"; } break;
                                case "İ": { cyrlStrs[j] = "І"; } break;
                                case "i": { cyrlStrs[j] = "і"; } break;
                                case "K": { cyrlStrs[j] = "К"; } break;
                                case "k": { cyrlStrs[j] = "к"; } break;
                                case "L": { cyrlStrs[j] = "Л"; } break;
                                case "l": { cyrlStrs[j] = "л"; } break;
                                case "M": { cyrlStrs[j] = "М"; } break;
                                case "m": { cyrlStrs[j] = "м"; } break;
                                case "N": { cyrlStrs[j] = "Н"; } break;
                                case "n": { cyrlStrs[j] = "н"; } break;
                                case "O": { cyrlStrs[j] = "О"; } break;
                                case "o": { cyrlStrs[j] = "о"; } break;
                                case "P": { cyrlStrs[j] = "П"; } break;
                                case "p": { cyrlStrs[j] = "п"; } break;
                                case "Q": { cyrlStrs[j] = "Қ"; } break;
                                case "q": { cyrlStrs[j] = "қ"; } break;
                                case "R": { cyrlStrs[j] = "Р"; } break;
                                case "r": { cyrlStrs[j] = "р"; } break;
                                case "T": { cyrlStrs[j] = "Т"; } break;
                                case "t": { cyrlStrs[j] = "т"; } break;
                                case "U": { cyrlStrs[j] = "Ұ"; } break;
                                case "u": { cyrlStrs[j] = "ұ"; } break;
                                case "V": { cyrlStrs[j] = "В"; } break;
                                case "v": { cyrlStrs[j] = "в"; } break;
                                case "Y": { cyrlStrs[j] = "Ы"; } break;
                                case "y": { cyrlStrs[j] = "ы"; } break;
                                case "Z": { cyrlStrs[j] = "З"; } break;
                                case "z": { cyrlStrs[j] = "з"; } break;
                                case "J": { cyrlStrs[j] = "Ж"; } break;
                                case "j": { cyrlStrs[j] = "ж"; } break;
                                default: { cyrlStrs[j] = chars[j].ToString(); } break;
                            }
                        }
                        latynWord = string.Empty;
                    }
                    cyrlStrs[i] = chars[i];
                    prevSound = Sound.Unknown;
                    continue;
                }
                latynWord += chars[i];
                prevSound = Sound.Unknown;
            }
            cyrlStrs[length - 1] = "";
            return string.Concat(cyrlStrs);
        }
