        #region Латынды төте жазуға +Latyn2Tote(string latynText)
        public static string Latyn2Tote(string latynText)
        {
            latynText = latynText.Replace("I", "ı");
            latynText = latynText.Replace("İ", "i");
            char[] chars = latynText.ToLower().ToCharArray();
            int length = chars.Length;
            string[] toteStrs = new string[length];
            for (int i = 0; i < length; i++)
            {
                if (i + 3 < length)
                {
                    string key = string.Concat(chars[i], chars[i + 1], chars[i + 2], chars[i + 3]);
                    switch (key)
                    {
                        case "shsh": { toteStrs[i] = "شش"; i += 3; continue; }
                    }
                }

                if (i + 1 < length)
                {
                    string key = string.Concat(chars[i], chars[i + 1]);
                    switch (key)
                    {
                        case "ıý": { toteStrs[i] = "يۋ"; i += 1; continue; }
                        case "ch": { toteStrs[i] = "چ"; i += 1; continue; }
                        case "sh": { toteStrs[i] = "ش"; i += 1; continue; }
                        case "ıa": { toteStrs[i] = "يا"; i += 1; continue; }
                        case "ıo": { toteStrs[i] = "يو"; i += 1; continue; }
                        case "á": { toteStrs[i] = "ءا"; i += 1; continue; }
                        case "ó": { toteStrs[i] = "ءو"; i += 1; continue; }
                        case "ú": { toteStrs[i] = "ءۇ"; i += 1; continue; }
                        case "ń": { toteStrs[i] = "ڭ"; i += 1; continue; }
                        case "ǵ": { toteStrs[i] = "ع"; i += 1; continue; }
                        case "ý": { toteStrs[i] = "ۋ"; i += 1; continue; }
                        case "ХХ": { toteStrs[i] = "ХХ"; i += 1; continue; }
                        case "ev": { toteStrs[i] = "يەۆ"; i += 1; continue; }
                        case "EV": { toteStrs[i] = "يەۆ"; i += 1; continue; }
                    }
                }
                switch (chars[i])
                {
                    case 'á': { toteStrs[i] = "ءا"; continue; }
                    case 'ó': { toteStrs[i] = "ءو"; continue; }
                    case 'ú': { toteStrs[i] = "ءۇ"; continue; }
                    case 'ń': { toteStrs[i] = "ڭ"; continue; }
                    case 'ǵ': { toteStrs[i] = "ع"; continue; }
                    case 'ý': { toteStrs[i] = "ۋ"; continue; }
                    case 'a': { toteStrs[i] = "ا"; } break;
                    case 'b': { toteStrs[i] = "ب"; } break;
                    case 's': { toteStrs[i] = "س"; } break;
                    case 'd': { toteStrs[i] = "د"; } break;
                    case 'e': { toteStrs[i] = "ە"; } break;
                    case 'f': { toteStrs[i] = "ف"; } break;
                    case 'g': { toteStrs[i] = "گ"; } break;
                    case 'h': { toteStrs[i] = "ح"; } break;
                    case 'i': { toteStrs[i] = "ءى"; } break;
                    case 'ı': { toteStrs[i] = "ي"; } break;
                    case 'k': { toteStrs[i] = "ك"; } break;
                    case 'l': { toteStrs[i] = "ل"; } break;
                    case 'm': { toteStrs[i] = "م"; } break;
                    case 'n': { toteStrs[i] = "ن"; } break;
                    case 'o': { toteStrs[i] = "و"; } break;
                    case 'p': { toteStrs[i] = "پ"; } break;
                    case 'q': { toteStrs[i] = "ق"; } break;
                    case 'r': { toteStrs[i] = "ر"; } break;
                    case 't': { toteStrs[i] = "ت"; } break;
                    case 'u': { toteStrs[i] = "ۇ"; } break;
                    case 'v': { toteStrs[i] = "ۆ"; } break;
                    case 'y': { toteStrs[i] = "ى"; } break;
                    case 'z': { toteStrs[i] = "ز"; } break;
                    case 'j': { toteStrs[i] = "ج"; } break;
                    case ',': { toteStrs[i] = "،"; } break;
                    case '?': { toteStrs[i] = "؟"; } break;
                    case ';': { toteStrs[i] = "؛"; } break;
                    default: { toteStrs[i] = chars[i].ToString(); } break;
                }
            }
            string toteText = string.Concat(toteStrs);

            string[] wordArr = toteText.Split(' ');
            for (int i = 0; i < wordArr.Length; i++)
            {
                if (wordArr[i].Contains("ء"))
                {
                    if (wordArr[i].Contains("ك") || wordArr[i].Contains("گ") || wordArr[i].Contains("ە"))
                    {
                        wordArr[i] = wordArr[i].Replace("ء", "") + " ";
                    }
                    else
                    {
                        wordArr[i] = "ء" + wordArr[i].Replace("ء", "") + " ";
                    }
                }
                else
                {
                    wordArr[i] += " ";
                }
            }

            return string.Concat(wordArr);
        }
        #endregion

        #region Төтені латынға +Tote2Latyn(string toteText)
        public static string Tote2Latyn(string toteText)
        {
            char[] chars = toteText.ToCharArray();
            int length = chars.Length;
            string[] latynStrs = new string[length];
            string[] pArr = { ".", "\r\n", ". ", "\r", "\n" };
            bool isUpperChar = false;
            for (int i = 0; i < length; i++)
            {
                if (i == 0 || (i > 0 && pArr.Contains(chars[i - 1].ToString()))
                    || (i > 1 && pArr.Contains(chars[i - 2].ToString() + chars[i - 1].ToString())))
                {
                    isUpperChar = true;
                }
                else
                {
                    isUpperChar = false;
                }
                if ("ء".Equals(chars[i].ToString()))
                {
                    latynStrs[i] = ""; continue;
                }
                if (i + 1 < length)
                {
                    string key = string.Concat(chars[i], chars[i + 1]);
                    switch (key)
                    {
                        case "ءا": { latynStrs[i] = isUpperChar ? "Á" : "á"; i += 1; continue; }
                        case "ءو": { latynStrs[i] = isUpperChar ? "Ó" : "ó"; i += 1; continue; }
                        case "ءۇ": { latynStrs[i] = isUpperChar ? "Ú" : "ú"; i += 1; continue; }
                        case "ءى": { latynStrs[i] = isUpperChar ? "İ" : "i"; i += 1; continue; }
                    }
                }

                switch (chars[i])
                {
                    case 'چ': { latynStrs[i] = isUpperChar ? "Ch" : "ch"; } break;
                    case 'ع': { latynStrs[i] = "ǵ"; } break;
                    case 'ش': { latynStrs[i] = isUpperChar ? "Sh" : "sh"; } break;
                    case 'ڭ': { latynStrs[i] = "ń"; } break;
                    case 'ۋ': { latynStrs[i] = "ý"; } break;
                    case 'ي': { latynStrs[i] = "ı"; } break;
                    case 'ا': { latynStrs[i] = "a"; } break;
                    case 'ب': { latynStrs[i] = "b"; } break;
                    case 'د': { latynStrs[i] = "d"; } break;
                    case 'ە': { latynStrs[i] = "e"; } break;
                    case 'ف': { latynStrs[i] = "f"; } break;
                    case 'گ': { latynStrs[i] = "g"; } break;
                    case 'ح': { latynStrs[i] = "h"; } break;
                    case 'ھ': { latynStrs[i] = "h"; } break;
                    case 'ك': { latynStrs[i] = "k"; } break;
                    case 'ل': { latynStrs[i] = "l"; } break;
                    case 'م': { latynStrs[i] = "m"; } break;
                    case 'ن': { latynStrs[i] = "n"; } break;
                    case 'و': { latynStrs[i] = "o"; } break;
                    case 'پ': { latynStrs[i] = "p"; } break;
                    case 'ق': { latynStrs[i] = "q"; } break;
                    case 'ر': { latynStrs[i] = "r"; } break;
                    case 'س': { latynStrs[i] = "s"; } break;
                    case 'ت': { latynStrs[i] = "t"; } break;
                    case 'ۇ': { latynStrs[i] = "u"; } break;
                    case 'ۆ': { latynStrs[i] = "v"; } break;
                    case 'ج': { latynStrs[i] = "j"; } break;
                    case 'ى': { latynStrs[i] = "y"; } break;
                    case 'ز': { latynStrs[i] = "z"; } break;
                    case '،': { latynStrs[i] = ","; } break;
                    case '؟': { latynStrs[i] = "?"; } break;
                    case '؛': { latynStrs[i] = ";"; } break;
                    default: { latynStrs[i] = chars[i].ToString(); } break;
                }

                if (isUpperChar && latynStrs[i] != null && !latynStrs[i].Equals("Ch")
                    && !latynStrs[i].Equals("Sh"))
                {
                    latynStrs[i] = QazLatynToUpper(latynStrs[i]);
                }
            }
            return string.Concat(latynStrs);
        }
        #endregion

        #region Латын сөздің дұрыстығын анықтау +IsLatynWord(string latynWord, out string errorLatynChars)
        public static bool IsLatynWord(string latynWord, out string errorLatynChars)
        {
            errorLatynChars = "";
            foreach (string item in ConvertHelper.cyrlChars)
            {
                if (item.Equals("-")) continue;
                if (latynWord.Contains(item, StringComparison.OrdinalIgnoreCase))
                {
                    errorLatynChars += string.IsNullOrEmpty(errorLatynChars) ? item : ","+ item;
                }
            }
            return string.IsNullOrEmpty(errorLatynChars);
        }
        #endregion

        #region Кирлл сөздің дұрыстығын анықтау +IsCyrlWord(string cyrlWord, out string errorCyrlChars)
        public static bool IsCyrlWord(string cyrlWord, out string errorCyrlChars)
