            errorCyrlChars = "";
            foreach (string item in ConvertHelper.latynChars)
            {
                if (item.Equals("-")) continue;
                if (cyrlWord.Contains(item, StringComparison.OrdinalIgnoreCase))
                {
                    errorCyrlChars += string.IsNullOrEmpty(errorCyrlChars) ? item : "," + item;
                }
            }
            return string.IsNullOrEmpty(errorCyrlChars);
        }
